INSERT INTO `p8_business_content_1` VALUES ('1','1272','1000031','<p>&nbsp;&nbsp;&nbsp;&nbsp; 输送带是由多层挂胶帆布粘合在一起或用其他骨架材料作带芯，外贴覆盖胶层，经成型硫化而制成的橡胶制品。他是胶带运输机的主要部件，起运载物料的作用。适用输送块状、粒状、粉末状物料和成件物品等。<br />　　根据结构和形状，输送带分为分层式织物芯输送带、波状挡边输送带、环形输送带。根据性能，输送带有分为耐热、耐油、耐酸碱、耐寒等类型。 </p>\r\n<p>□ 分层式织物芯输送带 □ 波状挡边输送带 □ 花纹输送带 □ 环形输送带<br />□ 尼龙(NN)帆布输送带□ 耐热输送带 □ 耐高温输送带<br />棉帆布 :CC56 TC70<br />NN尼龙:NN100 NN125 NN150 NN200 NN250 NN300 NN350 NN400<br />EP聚酯 :EP100 EP125 EP150 EP200 EP250 EP300 EP350 EP400<br />耐热 耐高温 耐灼烧 耐酸碱 耐腐蚀 耐磨 耐寒 环形 大倾角挡边 花纹等<br />宽度在：300mm-1600mm <br />宽度 布层数 可定做</p>\r\n<p><br />输送带型号<br />B400*4(3+1.5)&nbsp; 400*5（3+1.5） 400*5（3+1.5）400*4（4+2）400*5（4+2）等<br />B500*3（1.5+1.5）500*3（2+1） 500*3（3+1.5）500*4（3+1.5）500*4（4+2）500*4（4.5+1.5）<br />B500*5（3+1.5） 500*5（4.5+1.5）500*5（4+2） 500*5（6+1.5） 500*5（6+2） 500*6（3+1.5）<br />B500*6（4.5+1.5）等<br />B500*6（4+2） 500*7&nbsp; 500*8&nbsp; 500*9&nbsp;&nbsp; 500*10 等<br />B550*3（3+1.5） 550*4（3+1.5）550*4（4.5+1.5）550*4（4+2.）550*5(3+1.5) 550*5(4.5+1.5)<br />B550*5(4+2) 550*6（3+1.5）550*6(4.5+1.5) 550*6（4+2） 550*7 550*8 550*9 550*10等<br />B600*4（3+1.5）600*4（4.5+1.5）600*4（4+2）600*5（3+1.5） 600*5（4.5+1.5）<br />B600*5（4+2）等<br />B600*5（6+2） 600*6（3+1.5）600*6（4.5+1.5）600*6（4+2）600*6（6+2）<br />B650*4（3+1.5）650*4（4.5+1.5）650*4（4+2）650*5（3+1.5）650*5（4.5+1.5） 650*5（4+2）<br />B650*5（6+2）650*5（6+3）650*5（6+1.5）650*6（3+1.5）650*6（4.5+1.5）650*6（4+2）<br />B700*5（3+1.5）700*5（4.5+1.5））700*5（4+2）700*6（3+1.5）700*6（4.5+1.5）700*6（4+2）<br />B750*5(3+1.5)&nbsp; 750*5(4+2)&nbsp; 750*5(4.5+1.5)&nbsp; 750*6(3+1.5)&nbsp; 750*6(4.5+1.5)&nbsp; 750*6(4+2) <br />B800*4(3+1.5)&nbsp; 800*4(4.5+1.5)&nbsp; 800*4(4+2)&nbsp; 800*5(3+1.5)&nbsp; 800*5(4.5+1.5)&nbsp; 800*5(4+2) <br />B800*5(6+2)&nbsp; 800*5(6+3)&nbsp; 800*6(3+1.5)&nbsp; 800*6(3+1.5)&nbsp; 800*6(4.5+1.5)&nbsp; 800*6(4+2) B800*6(6+2)&nbsp; 800*6(6+3)&nbsp;&nbsp; 800*7(3+1.5)&nbsp; 800*7(4.5+1.5)&nbsp; 800*8 等<br />B1000*4（3+1.5）1000*4（4.5+1.5）1000*4（4+2）1000*5（3+1.5）1000*5（4.5+1.5）<br />B1000*5（4+2）1000*5（6+2）1000*5（6+3） 1000*6（3+1.5） 1000*6（8+2）1000*6（3+1.5）<br />B1000*6（4.5+1.5）1000*6（4+2）1000*6（6+2）1000*6（6+3）1000*7（3+1.5）<br />B1000*7（4.5+1.5）1000*7（4+2）1000*7（6+2）1000*7（6+3）1000*7（8+2）<br />B1000*8（3+1.5）B1000*8（4.5+1.5）1000*8（4+2）1000*8（6+2）1000*8（6+3）<br />B1000*8（8+2）等<br />B1100*4 1100*5&nbsp;&nbsp; 1100*6&nbsp;&nbsp; 1100*7&nbsp;&nbsp; 1100*8等<br />B1200*4（3+1.5）1200*4（4.5+1.5）1200*4（4+2）1200*5（3+1.5）1200*5（4.5+1.5）<br />B1200*5（4+2）1200*5（6+2）1200*5（6+3） 1200*6（3+1.5）1200*6（3+1.5）<br />B1200*6（4.5+1.5）1200*6（4+2）1200*6（6+2）1200*6（6+3）1200*7（3+1.5）<br />B1200*7（4.5+1.5）1200*7（4+2）1200*7（6+2）1200*7（6+3）1200*7（8+2）<br />B1200*8（3+1.5）B1200*8（4.5+1.5）1200*8（4+2）1200*8（6+2）1200*8（6+3）<br />B1200*8（8+2）等<br />B1300*4（3+1.5）1300*4（4.5+1.5）1300*4（4+2）1300*5（3+1.5）1300*5（4.5+1.5）<br />B1300*5（4+2）1300*5（6+2）1300*5（6+3） 1300*6（3+1.5） 1300*6（8+2）1300*6（3+1.5）<br />B1300*6（4.5+1.5）1300*6（4+2）1300*6（6+2）1300*6（6+3）1300*7（3+1.5）<br />B1300*7（4.5+1.5）1300*7（4+2）1300*7（6+2）1300*7（6+3）1300*7（8+2）<br />B1300*8（3+1.5）B1300*8（4.5+1.5）1300*8（4+2）1300*8（6+2）1300*8（6+3）<br />B1300*8（8+2）等<br />B1400*4（3+1.5）1400*4（4.5+1.5）1400*4（4+2）1400*5（3+1.5）1400*5（4.5+1.5）<br />B1400*5（4+2）1400*5（6+2）1400*5（6+3） 1400*6（3+1.5） 1400*6（8+2）1400*6（3+1.5）<br />B1400*6（4.5+1.5）1400*6（4+2）1400*6（6+2）1400*6（6+3）1400*7（3+1.5）<br />B1400*7（4.5+1.5）1400*7（4+2）1400*7（6+2）1400*7（6+3）1400*7（8+2）<br />B1400*8（3+1.5）B1400*8（4.5+1.5）1400*8（4+2）1400*8（6+2）1400*8（6+3）<br />B1400*8（8+2）等<br />B1500*4（3+1.5）1500*4（4.5+1.5）1500*4（4+2）1500*5（3+1.5）1500*5（4.5+1.5）<br />B1500*5（4+2）1500*5（6+2）1500*5（6+3） 1500*6（3+1.5） 1500*6（8+2）1500*6（3+1.5）<br />B1500*6（4.5+1.5）1500*6（4+2）1500*6（6+2）1500*6（6+3）1500*7（3+1.5）<br />B1500*7（4.5+1.5）1500*7（4+2）1500*7（6+2）1500*7（6+3）1500*7（8+2）<br />B1500*8（3+1.5）B1500*8（4.5+1.5）1500*8（4+2）1500*8（6+2）1500*8（6+3）<br />B1500*8（8+2）等<br />B1600*4（3+1.5）1600*4（4.5+1.5）1600*4（4+2）1600*5（3+1.5）1600*5（4.5+1.5）<br />B1600*5（4+2）1600*5（6+2）1600*5（6+3） 1300*6（3+1.5） 1600*6（8+2）1600*6（3+1.5）<br />B1600*6（4.5+1.5）1600*6（4+2）1600*6（6+2）1600*6（6+3）1600*7（3+1.5）<br />B1600*7（4.5+1.5）1600*7（4+2）1600*7（6+2）1600*7（6+3）1600*7（8+2）<br />B1600*8（3+1.5）B1600*8（4.5+1.5）1600*8（4+2）1600*8（6+2）1600*8（6+3）<br />B1600*8（8+2）等</p>\r\n<p>&nbsp;</p>','棉帆布，NN尼龙，EP聚酯，耐热，耐高温，大倾角挡边，环形，花纹等','50','0','平方米','7-10天内发货','','','0');
INSERT INTO `p8_business_content_1` VALUES ('2','1272','1000031','<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; WORD-BREAK: break-all; LINE-HEIGHT: 150%; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">输送带是由多层挂胶帆布粘合在一起或用其他骨架材料作带芯，外贴覆盖胶层，经成型硫化而制成的橡胶制品。他是胶带运输机的主要部件，起运载物料的作用。适用输送块状、粒状、粉末状物料和成件物品等。<span lang=EN-US><br /></span>　　根据结构和形状，输送带分为分层式织物芯输送带、波状挡边输送带、环形输送带。根据性能，输送带有分为耐热、耐油、耐酸碱、耐寒等类型。<span lang=EN-US> <br /><br />□ </span>分层式织物芯输送带<span lang=EN-US> □ </span>波状挡边输送带<span lang=EN-US> □ </span>花纹输送带<span lang=EN-US> □ </span>环形输送带<span lang=EN-US><?xml:namespace prefix = o ns = \"urn:schemas-microsoft-com:office:office\" /><o:p></o:p></span></span></p>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; WORD-BREAK: break-all; LINE-HEIGHT: 150%; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span lang=EN-US style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">□ </span><span style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">尼龙<span lang=EN-US>(NN)</span>帆布输送带<span lang=EN-US>□ </span>耐热输送带<span lang=EN-US> □ </span>耐高温输送带<span lang=EN-US><o:p></o:p></span></span></p>\r\n<p class=MsoNormal style=\"MARGIN: 0cm 0cm 0pt; WORD-BREAK: break-all; LINE-HEIGHT: 150%; TEXT-ALIGN: left; mso-pagination: widow-orphan\" align=left><span style=\"FONT-SIZE: 9pt; COLOR: #434343; LINE-HEIGHT: 150%; FONT-FAMILY: 宋体; mso-font-kerning: 0pt; mso-bidi-font-family: 宋体\">普通输送带<span lang=EN-US><o:p></o:p></span></span></p>\r\n<div align=center>\r\n<table class=MsoNormalTable style=\"WIDTH: 90%; mso-cellspacing: 0cm; mso-padding-alt: 0cm 0cm 0cm 0cm\" cellSpacing=0 cellPadding=0 width=\"90%\" border=1>\r\n<tbody>\r\n<tr style=\"mso-yfti-irow: 0; mso-yfti-firstrow: yes; mso-yfti-lastrow: yes\